import React from 'react';
import Case from './Case';


class Row extends React.Component{
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className={"row"+this.props.aorb}>
      <Case aorb={this.props.aorb}></Case>
      <Case aorb={this.props.aorb}></Case>
      <Case aorb={this.props.aorb}></Case>
      <Case aorb={this.props.aorb}></Case>
      </div>
    );
  }
}


export default Row;
